import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { AuthService } from 'src/app/service/auth.service';

@Component({
  selector: 'app-doctorsignup',
  templateUrl: './doctorsignup.component.html',
  styleUrls: ['./doctorsignup.component.css']
})
export class DoctorsignupComponent {
  doctor: any = {};

  constructor(private authSrv: AuthService, private router: Router){}

  onSubmit() {
    // Send the patient data to the server for insertion
    this.authSrv.doctorSignup(this.doctor)
      .subscribe(
        (response) => {
          console.log('Patient added successfully:', response);
          // Reset the form after successful submission
          this.router.navigate(['/doctorLogin'])
          this.doctor = {};
        },
        (error) => {
          console.error('Error adding patient:', error);
          // Handle error response here
        }
      );
  }

}
<div class="doctor-form-container">
  <form (ngSubmit)="onSubmit()" class="doctor-form">
    <h1 class="form-title">Doctor SignUp</h1>
    <div class="form-group">
      <label for="name">Name:</label>
      <input type="text" id="name" name="Name" [(ngModel)]="doctor.Name" required placeholder="Enter your name">
    </div>
    <div class="form-group">
      <label for="contactNumber">Contact Number:</label>
      <input type="text" id="contactNumber" name="ContactNumber" [(ngModel)]="doctor.ContactNumber" required placeholder="Enter your contact number">
    </div>
    <div class="form-group">
      <label for="email">Email:</label>
      <input type="email" id="email" name="Email" [(ngModel)]="doctor.Email" required placeholder="Enter your email">
    </div>
    <div class="form-group">
      <label for="scheduling">Scheduling:</label>
      <input type="text" id="scheduling" name="Scheduling" [(ngModel)]="doctor.Scheduling" required placeholder="Enter your scheduling details">
    </div>
    <div class="form-group">
      <label for="password">Password:</label>
      <input type="password" id="password" name="Password" [(ngModel)]="doctor.Password" required placeholder="Create a password">
    </div>
    <button type="submit" class="submit-btn">Submit</button>
    <div class="link-container">
      <a routerLink="/login">Patient Login</a>
      <a routerLink="/doctorLogin">Doctor Login</a>
    </div>
  </form>
</div>
